"use strict";exports.timeAgo=function(e){const t=new Date,r=new Date(e),n=(t.getTime()-r.getTime())/1e3;if(n<60)return`${Math.round(n)} 秒前`;if(n<3600)return`${Math.round(n/60)} 分钟前`;if(n<86400)return`${Math.round(n/3600)} 小时前`;if(n<604800)return`${Math.round(n/86400)} 天前`;if(n<2419200)return`${Math.round(n/604800)} 周前`;if(n<31536e3){return`${12*(t.getFullYear()-r.getFullYear())+(t.getMonth()-r.getMonth())} 月前`}return`${t.getFullYear()-r.getFullYear()} 年前`};
